import React from 'react';

function AboutProject () {
    return (
        <section className="AboutProject">
            <h1 className="AboutProject__title">О проекте</h1>
            <p1 className="AboutProject__description">Дипломный проект включал 5 этапов</p1>
            <p2 className="AboutProject__description">На выполнение диплома ушло 5 недель</p2>
            <p3 className="AboutProject__description">
                Составление плана, работу над бэкендом, вёрстку,
                добавление функциональности и финальные доработки.
            </p3>
            <p4 className="AboutProject__description">
                У каждого этапа был мягкий и жёсткий дедлайн,
                которые нужно было соблюдать, чтобы успешно защититься.
            </p4>
        </section>
    );
}

export default AboutProject;
